import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu hamburger (nav-menu) to be visible
    const navMenuSelector = '.nav-menu';
    await page.waitForSelector(navMenuSelector, { timeout: 5000 });

    // Click the mobile menu button ("All")
    await page.click(navMenuSelector);
    await page.waitForTimeout(400); // Small pause for animation

    // Wait for the mobile menu overlay to appear (using overlay class and .show)
    const mobileMenuOverlaySelector = '#mobileMenuOverlay.show';
    await page.waitForSelector(mobileMenuOverlaySelector, { timeout: 5000 });

    // Screenshot after menu opens
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_opened.png'));

    // Extract visible mobile menu links (using XPath for visible links inside overlay)
    const menuLinks = await page.$$eval(
      "#mobileMenuOverlay.show a",
      nodes => nodes.map(n => n.textContent.trim()).filter(Boolean)
    );

    // Click a category link (e.g., "Electronics") in the mobile menu
    // Use XPath to find the first visible "Electronics" link inside the overlay
    const electronicsLinkXPath = "//div[contains(@id,'mobileMenuOverlay') and contains(@class,'show')]//a[contains(.,'Electronics')]";
    const [electronicsLink] = await page.$x(electronicsLinkXPath);
    if (electronicsLink) {
      await electronicsLink.click();
      await page.waitForTimeout(500); // Wait for navigation/animation
    }

    // Screenshot after clicking a category
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_category_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_category_clicked.png'));

    // Close the mobile menu using the close button inside overlay (white X)
    // Use a selector for the close button inside the overlay
    const closeBtnXPath = "//div[contains(@id,'mobileMenuOverlay') and contains(@class,'show')]//button[contains(@class,'close-mobile-menu')]";
    const [closeBtn] = await page.$x(closeBtnXPath);
    if (closeBtn) {
      await closeBtn.click();
      await page.waitForTimeout(400);
    }

    // Wait for the overlay to disappear
    await page.waitForSelector(mobileMenuOverlaySelector, { state: 'hidden', timeout: 5000 });

    // Screenshot after closing menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    // Extract the current main heading or category title after navigation
    let categoryTitle = '';
    try {
      // Try to get the <h2> inside .category-results or .search-results
      categoryTitle = await page.$eval('.category-results h2, .search-results h2', el => el.textContent.trim());
    } catch (e) {
      // Fallback: get the hero banner heading if on home
      try {
        categoryTitle = await page.$eval('.hero-banner h2', el => el.textContent.trim());
      } catch (e2) {
        categoryTitle = '';
      }
    }

    return {
      success: true,
      action: "Tested mobile menu navigation: opened menu, clicked 'Electronics', closed menu, and verified navigation.",
      extractedData: {
        mobileMenuLinks: menuLinks,
        navigatedCategoryTitle: categoryTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
